import { Component } from 'react';
import './Detail.css'
//import PropTypes from "prop-types";
import React from "react";

class Detail extends Component {
    constructor(props) {
        super(props);
    }  

    render() {
        return (
            <div class="Detail" id = "DetailID">
                {this.props.player.id}
            </div>
        );
    }
}

export default Detail;
